import React from "react";

import "./Footer.css";

const Footer = () => {
  return (
    <footer id="footer">
      <h4>Developed By NVG team</h4>
      <h5>
        hello@nvg-group.com © Copyright 2015-2020 New Vektor Group - Все права
        защищены Правила, Политика Конфиденциальности
      </h5>
    </footer>
  );
};

export default Footer;
